        // palauttaa käden yllä olevasta taulukosta
        public int[] handIndexToHand(int handIndex)
        {
            int[] hand = new int[2];
            while (valueToHand[handIndex, 0] == 0 && valueToHand[handIndex, 1] == 0)
                handIndex++;
            hand[0] = valueToHand[handIndex, 0];
            hand[1] = valueToHand[handIndex, 1];
            return hand;
        }


        // palauttaa satunnaisen käden jonka vahvuus välillä [1,100]
        public void handIndexToRandomHand(int index, int[] myHand)
        {
            int[,] hands = new int[100,2];
            int count = 0;

            // käydään kaikki mahdoliset kombinaatiot läpi ja laitetaan ne taulukkoon
            for (int i = 0; i < 52; i++)
            {
                for (int a = 0; a < 52; a++)
                {
                    if (i == a)
                        continue;
                    if (handValues[i, a] == index)
                    {
                        //Console.WriteLine("hands[{0}] = {1}", count*2, i);
                        hands[count,0] = i;
                        //Console.WriteLine("hands[{0}] = {1}", count * 2, hands[count * 2]);
                        hands[count,1] = a;
                        count++;
                        //Console.WriteLine(i + " " + a);
                    }
                }
            }

            // siltä varalta, että kyseistä vahvuutta ei löydy taulukosta, niin etsitään yhtä heikompaa
            if (count == 0)
            {
                int tmpIndex = index + 1;
                for (int i = 0; i < 52; i++)
                {
                    for (int a = 0; a < 52; a++)
                    {
                        if (i == a)
                            continue;
                        if (handValues[i, a] == tmpIndex)
                        {
                            hands[count,0] = i;
                            hands[count,1] = a;
                            count++;
                        }
                    }
                }
            }

            //Console.WriteLine("count: " + count);
            //for (int i = 0; i < count; i++)
            //    Console.WriteLine(hands[count * 2] + " " + hands[count * 2+1]);

            Random random = new Random();
            int returnIndex = random.Next(0, count);
            //int returnIndex = 0;

            myHand[0] = hands[returnIndex,0];
            myHand[1] = hands[returnIndex,1];

            //Console.WriteLine("hands1: {0} hands1: {1}", hands[count * 2], hands[count * 2 + 1]);
            //Console.WriteLine("count: {0} returnIndex: {1} myHand[0]: {2} myHand[1]: {3}", count, returnIndex, myHand[0], myHand[1]);
        }


        // tulostaa taulukon, jonka ensimmäinen indeksi on prosentti [1,100] ja toisessa 
        // ulottuvuudessa on ensimmäinen käsi, joka vastaa tätä EV -prosenttia
        public void printEVtoHandArray()
        {
            int t = 0;
            int[,] array = new int[101, 2];
            while (t < 101)
            {
                for (int b = 0; b < 52; b++)
                {
                    for (int a = 0; a < 52; a++)
                    {
                        // ei voi olla kahta samaa korttia kädessä
                        if (a == b)
                            continue;
                        if (handValues[b, a] == t)
                        {
                            array[t,0] = b;
                            array[t,1] = a;
                            a = 53;
                            b = 53;
                        }
                    }
                }
                t++;
            }

            Console.WriteLine("static readonly int[,] valueToHand = {");
            for (int w = 0; w <= 100; w++)
            {
                //Console.WriteLine("{0}\t({1}, {2})", w, array[w,0], array[w,1]);
                Console.Write("{");
                Console.Write("{0},{1}", array[w, 0], array[w, 1]);
                Console.Write("},");
            }
            Console.WriteLine("};");
        }


        public string handToStr(int[] hand)
        {
            string[] valueStr = { "2", "3", "4", "5", "6", "7", "8", "9", "T", "J", "Q", "K", "A" };
            int value1 = hand[0] % 13;
            int land1 = hand[0] / 13;
            int value2 = hand[1] % 13;
            int land2 = hand[1] / 13;

            if (value2 > value1)
            {
                int tmp = value1;
                value1 = value2;
                value2 = tmp;
            }

            //Console.WriteLine("value1: " + value1 + " land1: " + land1 + " value2: " + value2 + " land2: " + land2);

            string tmpStr = valueStr[value1] + valueStr[value2];
            if (land1 == land2)
                return tmpStr + "s";
            else if (value1 == value2)
                return tmpStr;
            else
                return tmpStr + "o";
        }
        

        public int handToValue(int[] hand)
        {
            return handValues[hand[0], hand[1]];
        }
